              onSuccess={responseGoogle}
              onFailure={responseGoogle}
              cookiePolicy={'single_host_origin'}
            />


             {/* <div className='p-2 bg-[#065AD8] rounded text-white'>
              {/* <TbSocial /> */}
             {/* </div>
             <span className='text-2x1 text-[#065AD8] ' font-semibold>
                SNEAK IN
